import React, { useRef } from 'react';
import emailjs from 'emailjs-com';

const ContactUs = () => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs.sendForm('service_gnaygob', 'template_prv11tb', form.current, 'LzGo5aMLcr8ZSb-ek')
      .then((result) => {
          alert("enviado")
          console.log(result)
      }, (error) => {
          alert("error")
          console.log(error.text);
      });


  };

  return (
    <form className='d-flex' ref={form} onSubmit={sendEmail}>
      <label>Name</label>
      <input type="text" name="user_name" />
      <label>Email</label>
      <input type="email" id="email" name="from_name"/>
      <label>Message</label>
      <textarea name="message" />
      <input type="submit" value="Send" />
    </form>
  );
  
};

export default ContactUs;
